import Link from 'next/link';

const Index = () => (
    <div className='outerdiv'>
        <div className='titlelogo'>
            <Link href='/'>
                <a>slern.io</a>
            </Link>
        </div>
        <div className='signin'>
            <Link href='/login'>
                <a>Sign in</a>
            </Link>
        </div>

        <style jsx>{`
        .outerdiv {
            background-color: #B0D3F3;
            width: 100%;
            height: auto;
            display: grid;
            font-family: Arial;  
            grid-template-columns: 95% 5%;
            margin-left: -8px;
            margin-top: -8px;
            font-size: 20px;

        }
        .titlelogo {
            color: #2181D5;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
        }
        .signin {
           background-color: green;
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }

          a:hover {
            opacity: 0.6;
          }
          body {
            margin:0;
            padding:0;
          }

        `}</style>
    </div>
);

export default Index;
